import styled from "styled-components";
import React,{useEffect} from 'react'
import { useSelector} from 'react-redux'
import useCheckInAction from '../../hooks/useCheckInAction'
import {RootState} from '../../store/reducers'
import Moment from 'react-moment';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';


const LayoutDashboard = styled.div`
  flex: 7 1 0%;
  background-color: rgba(255,214,107,1);
  display: flex;
  flex-direction: column;

`;
interface Column {
  id: 'No' | 'Name' | 'Check-In' | 'Check-Out' | 'Note';
  label: string;
  minWidth?: number;
  align?: 'right';
  format?: (value: number) => string;
}
const columns: Column[] = [
  { id: 'No', label: 'No', minWidth: 170 },
  { id: 'Name', label: 'Name', minWidth: 170 },
  { id: 'Check-In', label: 'Check-In', minWidth: 170 },
  { id: 'Check-Out', label: 'Check-Out', minWidth: 170 },
  { id: 'Note', label: 'Note', minWidth: 170 },

];
interface Data {
  No: number;
  Name: string;
  CheckIn: string;
  CheckOut: string;
  Note: string;
}

function createData(No: number, Name: string, CheckIn: string, CheckOut: string, Note: string): Data {
  return { No, Name, CheckIn, CheckOut, Note };
}

const useStyles = makeStyles({
  root: {
    width: '100%',
  },
  container: {
    maxHeight: 440,
  },
});


function TableTime() {

    const {getTimeOfEmpsToday} = useCheckInAction()
    const emps = useSelector((state: RootState) => state.checkIn.todayEmps)
    const [page, setPage] = React.useState(0);
    const [rowsPerPage, setRowsPerPage] = React.useState(10);

    const handleChangePage = (event: unknown, newPage: number) => {
      setPage(newPage);
    };
    const handleChangeRowsPerPage = (event: React.ChangeEvent<HTMLInputElement>) => {
      setRowsPerPage(+event.target.value);
      setPage(0);
    };


    useEffect(() => {
        getTimeOfEmpsToday();
    }, [getTimeOfEmpsToday])
    console.log("emps emps:", emps)

      return (
        <Paper className="classes.root">
           <TableContainer className="classes.container">
           <Table stickyHeader aria-label="sticky table">
           <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
               <TableBody>
          {emps.map((items : any) =>(
                                    <tr key ={items}>
                                        <td className=" text-left py-3 px-4">1</td> 
                                        <td className=" text-left py-3 px-4">{items.nickName}</td>
                                        <td className="text-left py-3 px-4"><Moment format="hh:mm">{items.checkIn}</Moment></td>
                                        <td className="text-left py-3 px-4"><Moment format="hh:mm">{items.checkOut}</Moment></td>
                                        <td className="text-left py-3 px-4">{items.note}</td>
                                </tr>   
                                ))}
               </TableBody>
           </Table>
           </TableContainer>
           <TablePagination
              rowsPerPageOptions={[10, 25, 100]}
              component="div"
              count={emps.length}
              rowsPerPage={rowsPerPage}
              page={page}
              onChangePage={handleChangePage}
              onChangeRowsPerPage={handleChangeRowsPerPage}
      />
        </Paper>
        )
    }
export default TableTime
